def randomPostcode(city):
    """
    This function can generate syntactically correct but non validated UK postcode

    :return: string with a random postcode
    """
    area = ''
    if(city == 'London'):
        area = random.choice(['W','E', 'N', 'SE', 'SW'])
    elif (city == 'Birmingham' or city == 'Glasgow' or city == 'Liverpool' or city == 'Manchester'):
        area = city[:1]
    elif (city == 'Leeds'):
        area = 'LS'
    elif (city == 'Bristol'):
        area = 'BS'
    else:
        area = city[:2].upper()

    return area + str(random.randint(1, 30)) + ' ' + str(random.randint(1, 9)) + randomString(2).upper()

